insert into proxybuyboard values( pr_num.nextval, 'pie1111', '김파이1111', 'baby', '대통령은 제3항과 제4항의 사유를 지체없이 공포하여야 한다....', '국가는 재해를 예방하고 그 위험으로부터 국민을 보호하기 위하여 노력하여야 한다. 국회의원은 그 지위를 남용하여 국가·공공단체 또는 기업체와의 계약이나 그 처분에 의하여 재산상의 권리·이익 또는 직위를 취득하거나 타인을 위하여 그 취득을 알선할 수 없다.', 'default.png', 'img1.jpg/', '12', '#세제#샴푸#선물세트', 0, TO_DATE('20240201','YYYYMMDD'), TO_DATE('20240201','YYYYMMDD'), TO_DATE('20240210','YYYYMMDD'), 4, 1, 40000, 10000, '11:11:11:11', 0);
