insert into proxybuyboard values( pr_num.nextval, 'pie1113', '김파이1113', 'life', '국가는 노인과 청소년의 복지향상을 위한 정책을 실시할 의무를 ...', '사면·감형 및 복권에 관한 사항은 법률로 정한다. 신체장애자 및 질병·노령 기타의 사유로 생활능력이 없는 국민은 법률이 정하는 바에 의하여 국가의 보호를 받는다.', 'default.png', 'img3.jpg/', '9', '#자켓#가을#체크', 0, TO_DATE('20240203','YYYYMMDD'), TO_DATE('20240203','YYYYMMDD'), TO_DATE('20240212','YYYYMMDD'), 8, 1, 30000, 3750, '11:11:11:13', 0);
insert into proxybuyboard values( pr_num.nextval, 'pie1114', '김파이1114', 'beautyAndFashion', '모든 국민은 인간다운 생활을 할 권리를 가진다. 대통령이 임시...', '제2항과 제3항의 처분에 대하여는 법원에 제소할 수 없다. 모든 국민은 인간으로서의 존엄과 가치를 가지며, 행복을 추구할 권리를 가진다. 국가는 개인이 가지는 불가침의 기본적 인권을 확인하고 이를 보장할 의무를 진다.', 'default.png', 'img4.jpg/', '22', '#강아지#원단#베레모', 0, TO_DATE('20240204','YYYYMMDD'), TO_DATE('20240204','YYYYMMDD'), TO_DATE('20240213','YYYYMMDD'), 5, 1, 50000, 10000, '11:11:11:14', 0);
