insert into proxybuyboard values( pr_num.nextval, 'pie1116', '김파이1116', 'pet', '농업생산성의 제고와 농지의 합리적인 이용을 위하거나 불가피한...', '대통령은 헌법과 법률이 정하는 바에 의하여 공무원을 임면한다. 공무원인 근로자는 법률이 정하는 자에 한하여 단결권·단체교섭권 및 단체행동권을 가진다.', 'default.png', 'img6.jpg/', '16', '#게임팩#pc', 0, TO_DATE('20240206','YYYYMMDD'), TO_DATE('20240206','YYYYMMDD'), TO_DATE('20240215','YYYYMMDD'), 1, 1, 100000, 100000, '11:11:11:16', 0);
