insert into proxybuyboard values( pr_num.nextval, 'pie1118', '김파이1118', 'food', '제1항의 탄핵소추는 국회재적의원 3분의 1 이상의 발의가 있어야...', '국회의원이 회기전에 체포 또는 구금된 때에는 현행범인이 아닌 한 국회의 요구가 있으면 회기중 석방된다. 국가는 건전한 소비행위를 계도하고 생산품의 품질향상을 촉구하기 위한 소비자보호운동을 법률이 정하는 바에 의하여 보장한다.', 'default.png', 'img2.jpg/', '14', '#강아지#원단#베레모', 0, TO_DATE('20240208','YYYYMMDD'), TO_DATE('20240208','YYYYMMDD'), TO_DATE('20240217','YYYYMMDD'), 5, 1, 20000, 4000, '11:11:11:18', 0);
insert into proxybuyboard values( pr_num.nextval, 'pie1119', '김파이1119', 'life', '감사원은 세입·세출의 결산을 매년 검사하여 대통령과 차년도국...', '국회의원은 국회에서 직무상 행한 발언과 표결에 관하여 국회외에서 책임을 지지 아니한다. 연소자의 근로는 특별한 보호를 받는다. 국가유공자·상이군경 및 전몰군경의 유가족은 법률이 정하는 바에 의하여 우선적으로 근로의 기회를 부여받는다.', 'default.png', 'img3.jpg/', '26', '#세제#샴푸#선물세트', 0, TO_DATE('20240209','YYYYMMDD'), TO_DATE('20240209','YYYYMMDD'), TO_DATE('20240218','YYYYMMDD'), 6, 1, 70000, 11667, '11:11:11:19', 0);
