insert into proxybuyboard values( pr_num.nextval, 'pie1121', '김파이1121', 'etc', '국회는 국정을 감사하거나 특정한 국정사안에 대하여 조사할 수 ...', '공무원의 직무상 불법행위로 손해를 받은 국민은 법률이 정하는 바에 의하여 국가 또는 공공단체에 정당한 배상을 청구할 수 있다. 이 경우 공무원 자신의 책임은 면제되지 아니한다.', 'default.png', 'img5.jpg/', '27', '#자켓#가을#체크', 0, TO_DATE('20240211','YYYYMMDD'), TO_DATE('20240211','YYYYMMDD'), TO_DATE('20240220','YYYYMMDD'), 1, 1, 70000, 70000, '11:11:11:21', 0);
