insert into proxybuyboard values( pr_num.nextval, 'pie1144', '김파이1144', 'beautyAndFashion', '대통령의 임기는 5년으로 하며, 중임할 수 없다. 제3항의 승인을...', '대통령은 취임에 즈음하여 다음의 선서를 한다. 국회는 국민의 보통·평등·직접·비밀선거에 의하여 선출된 국회의원으로 구성한다. 대통령은 제1항과 제2항의 처분 또는 명령을 한 때에는 지체없이 국회에 보고하여 그 승인을 얻어야 한다.', 'default.png', 'img4.jpg/', '41', '#게임팩#pc', 1, TO_DATE('20240305','YYYYMMDD'), TO_DATE('20240305','YYYYMMDD'), TO_DATE('20240314','YYYYMMDD'), 4, 1, 90000, 22500, '11:11:11:44', 0);
