insert into proxybuyboard values( pr_num.nextval, 'pie1150', '김파이1150', 'beautyAndFashion', '군인·군무원·경찰공무원 기타 법률이 정하는 자가 전투·훈련...', '국가는 노인과 청소년의 복지향상을 위한 정책을 실시할 의무를 진다. 대통령의 선거에 관한 사항은 법률로 정한다. 모든 국민은 헌법과 법률이 정한 법관에 의하여 법률에 의한 재판을 받을 권리를 가진다.', 'default.png', 'img4.jpg/', '27', '#강아지#원단#베레모', 1, TO_DATE('20240311','YYYYMMDD'), TO_DATE('20240311','YYYYMMDD'), TO_DATE('20240320','YYYYMMDD'), 3, 1, 80000, 26667, '11:11:11:50', 0);
